import { useEffect, useState } from "react";
import Log from "./log";
import Main from "./main";
import './app.css'
function App() {
  const [log,setlog]=useState(false);
  return (
    <div className="App">
      <div className="head">
        <div className="headimg"></div>
      </div>
      <Log/>
    </div>
  );
}

export default App;
